exports.BlackJack_Step = (bjConfig, chatId) => `O jogo irá continuar, a jogada agora é de @${bjConfig[chatId].atualPlayer}, você tem 2 minutos para fazer a jogada, o jogo continuará após 2 minutos.\n\nVocê pode verificar suas cartas indo no meu privado e digitando "${prefix}21 -Mycard".\n\nQuando tiver finalizado, volte no grupo e escolha entre "stop", "drop", "pass" e "get".\n\nStop retira você do jogo, podendo vencer se tiver exatos 21.\n\nDrop dropará uma carta de sua escolha.\n\nPass faz com que você pule a rodada.\n\nGet faz você pegar uma carta.\n\nExemplo -> "${prefix}21 -Drop 2C"`;

exports.BlackJack_First = (bjConfig, chatId) => `As preparações terminaram, a vez da jogada é de @${bjConfig[chatId].atualPlayer}, o jogador tem 2 minuto para fazer a jogada, o jogo continuará após 2 minuto.\n\nVocê pode verificar suas cartas indo no meu privado e digitando "${prefix}21 -Mycard".\n\nQuando tiver finalizado, volte no grupo e escolha entre "stop", "drop", "pass" e "get".\n\nStop retira você do jogo, podendo vencer se tiver exatos 21.\n\nDrop dropará uma carta de sua escolha.\n\nPass faz com que você pule a rodada.\n\nGet faz você pegar uma carta.\n\nExemplo -> "${prefix}21 -Drop 2C"\n\nJogadores validos:\n-> ${bjConfig[chatId].validPlayers.map(g => g.toString().replace('@c.us', '')).join('\n-> @')}`;

exports.BlackJack_ExitLose = (sender) => `O jogador "@${sender.id.replace('@c.us', '')}" possui mais de 21 pontos, portanto, ele saiu sem ganhar.\nEspere o tempo para a próxima jogada.`;

exports.BlackJack_ExitWin = (sender) => `O jogador "@${sender.id.replace('@c.us', '')}" possui exatos 21 pontos, portanto, ele venceu este jogo!`;

exports.BlackJack_ExitNone = (sender) => `O jogador "@${sender.id.replace('@c.us', '')}" desistiu da partida antes de ter ou passar de 21.\n\nEspere o tempo para a próxima jogada.`;

exports.BlackJack_NoPlayers = () => `O número de jogadores não é o suficiente para o jogo, cancelarei o jogo por falta de players.`;

exports.BlackJack_NoDrop = () => `Você apenas pode dropar cartas que possui, você não possui a que informou, drope antes que o tempo acabe.`;

exports.BlackJack_OneDrop = () => `Você não pode dropar enquanto tiver apenas uma cartas, passe ou pegue uma.`;

exports.BlackJack_Droped = (sender, args, bjConfig, chatId) => `O jogador "@${sender.id.replace('@c.us', '')}" dropou um "${args[1].toUpperCase()}".\n\nO Deck atual é: ${tools('blackjack').getDeck(bjConfig[chatId])}\nEspere o tempo para a próxima jogada.`;

exports.BlackJack_EndPlayers = (bjConfig, chatId) => `O número de jogadores validos com cartas não é o suficiente para o jogo, portanto, @${bjConfig[chatId].validPlayers[0].replace('@c.us', '')} venceu este jogo.`;

exports.BlackJack_Begin = () => `Partida iniciada, os participantes - exceto você - tem até 2 minutos para entrar no jogo, basta digitar "${prefix}21 -join".`;

exports.BlackJack_Started = () => `O jogo possui os requisitos, portanto, o jogo esta oficialmente aberto!\n\nVão ao meu privado e digitem "${prefix}21 -Mydeck" para receber suas cartas, vocês tem 2 minutos.`;

exports.BlackJack_Bypass = (newCard) => `Você recebeu um "${newCard}" e seu valor passou de 21, você foi desclassificado por derrota.`;

