exports.BlackJack_Deck = (bjConfig, chatId, sender) => `Seu deck atual é:\n\n${bjConfig[chatId].deck[sender.id].join('-> ')}\n\nBoa sorte!`;

exports.BlackJack_Receive = (bjConfig, chatId) => `Enviei sua carta/deck no privado, confira para planejar sua próxima jogada, o restante dos jogadores devem esperar o tempo acabar para que o jogo continue.\n\nDeck atual ->\n${tools('blackjack').getDeck(bjConfig[chatId])}`;

exports.BlackJack_Pass = (bjConfig, chatId) => `O jogador pulou a rodada, aguardem que o tempo termine para o jogo avançar.\n\nDeck atual ->\n${tools('blackjack').getDeck(bjConfig[chatId])}`;

exports.BlackJack_Invited = (bjConfig, chatId) => `Sua inscrição foi concluída com sucesso, aguarde ${((bjConfig[chatId].startedAt - moment().unix()) / 60).toFixed(2)} Minutos para o inicio do jogo!\n\nPlayers atualmente > ${bjConfig[chatId].players.length}`;

exports.BlackJack_Cards = (bjConfig, lugarJ, sender) => `Você recebeu suas duas cartas, elas são:\n\n-> ${bjConfig[lugarJ].deck[sender.id][0]}\n-> ${bjConfig[lugarJ].deck[sender.id][1]}\n\nVolte ao grupo e siga as instruções para que continue com sua jogada antes que o seu tempo de jogo acabe.`;

