exports.fail = (command, error, time) => {
	let err = error.stack ? error.stack.split("\n")[1] : '\\Erro desconhecido';
	let sterr = err.slice(err.lastIndexOf("\\") + 1, -1).split(':') || 'Unknown';
	let hidedHost = hideMyDono ? '' : ` envie isso ao meu host [wa.me/${config.Owner[0].replace('@c.us', '')}] ou `;
	return `😵 _Ooops, algo de errado aconteceu comigo, de uma olhada nos detalhes abaixo e se puder${hidedHost} use o_ *${prefix}help!*\n\n🤖 - Lembre-se, os erros podem ser referentes ao servidor, WA_Automate, mensagens que não recebi/tenho ou ajustes incorretos das minhas configurações, nem sempre é um erro meu ou no meu código.\n\n#️⃣  - "${prefix}${command}"\n\n❓- "${error.name}"\n\n❌ - "${error.message}"\n\n📅 - "${time}"\n\n❗ - "${error.name == 'TypeError' ? 'O código possui uma falha de programação.' : error.name == 'ReferenceError' ? 'O código não possui uma variável requisitada - ['+error.message.slice(0, -15)+'].' : 'Erro não detalhado, descrição acima.'}"\n\n📁 - "${sterr[0]}"\n\n🧶 - "Linha #${sterr[1]}\n\n🔍 - "Caractere #${sterr[2]}"\n\n🔭 - ${my_files.includes(sterr[0]) && !sterr[0].includes('node') ? 'Aparentemente o erro pode estar em meu sistema.' : 'Aparentemente não é um erro no meu sistema.'}\n\n🐕 - Erros que não são do meu sistema ainda podem ser causados por má ajuste das minhas configurações, mensagens 'inexistentes' ou erros 'invisíveis' nos meus códigos.\n\n`;
};

