exports.wttr = (wttrin) => `────────────\n\n⚠️ → Informações sobre o clima de agora.\n\n🌆 Local → ${wttrin.nearest_area.map((j, i) => j.areaName[i].value+', '+j.region[i].value+', '+j.country[i].value).flat().join(' | ')}\n\n©️ Temperatura atual → ${wttrin.current_condition.map(j => j.temp_C).flat().join(' | ')} C° - [${wttrin.current_condition.map(j => j.temp_F).flat().join(' | ')} F°]\n\n🌡️ Sensação térmica → ${wttrin.current_condition.map(j => j.FeelsLikeC).flat().join(' | ')} C° = [${wttrin.current_condition.map(j => j.FeelsLikeF).flat().join(' | ')} F°]\n\n🚰 Umidade → ${wttrin.current_condition.map(j => j.humidity).flat().join(' | ')}%\n\n💧 Chuva em polegadas → ${wttrin.current_condition.map(j => j.precipInches).flat().join(' | ')} Pol - [${wttrin.current_condition.map(j => j.precipMM).flat().join(' | ')} MM]\n\n☁️ Cobertura de nuvens → ${wttrin.current_condition.map(j => j.cloudcover).flat().join(' | ')}%\n\n😮‍💨 Pressão do ar → ${wttrin.current_condition.map(j => j.pressure).flat().join(' | ')} hPa - [${wttrin.current_condition.map(j => j.pressureInches).flat().join(' | ')} mmHg]\n\n☀️ Indice de UV. → ${wttrin.current_condition.map(j => j.uvIndex).flat().join(' | ')}\n\n🕶️ Nivel de visibilidade → ${wttrin.current_condition.map(j => j.visibility).flat().join(' | ')} KM - [${wttrin.current_condition.map(j => j.visibilityMiles).flat().join(' | ')} M.]\n\n❓ Descrição do clima → ${wttrin.current_condition.map(j => j.weatherDesc).flat().map(j => j.value).flat().join(', ')} - [ID #${wttrin.current_condition.map(j => j.weatherCode).flat().join(' | ')}]\n\n➡️ Direção do vento → ${wttrin.current_condition.map(j => j.winddir16Point).flat().join(', ')} - [${wttrin.current_condition.map(j => j.winddirDegree).flat().join(', ')}°]\n\n🐌 Velocidade do vento em KM → ${wttrin.current_condition.map(j => j.windspeedKmph).flat().join(', ')} KM - [${wttrin.current_condition.map(j => j.windspeedMiles).flat().join(', ')} M.]\n\n────────────\n${wttrin.weather.map(p => '\n'+'⚠️ Informações sobre o clima do dia → '+p.date+'\n\n🍨 Temperatura mínima → '+p.mintempC+' C° - ['+p.mintempF+' F°]\n\n🏖️ Temperatura media → '+p.avgtempC+' C° - ['+p.avgtempF+' F°]\n\n🔥 Temperatura máxima → '+p.maxtempC+' C° - ['+p.maxtempF+' F°]\n\n🗿 Hora solar → '+p.sunHour+'h\n\n❄️ Total de neve → '+p.totalSnow_cm+' CM\n\n🧴 Índice de UV. → '+p.uvIndex+'\n\n🌙 Luz da lua → '+p.astronomy.map(j => j.moon_illumination).flat().join(' | ')+'%\n\n🌖 Fase da lua → '+p.astronomy.map(j => j.moon_phase).flat().join(' | ')+'\n\n🌚 Lua nasce(u) as → '+p.astronomy.map(j => j.moonrise).flat().join(' | ')+'\n\n🌝 Lua se põe(põs) as → '+p.astronomy.map(j => j.moonset).flat().join(' | ')+'\n\n🌅 Sol nasce(u) as → '+p.astronomy.map(j => j.sunrise).flat().join(' | ')+'\n\n🌇 Sol se põe(põs) as → '+p.astronomy.map(j => j.sunset).flat().join(' | ')+'\n\n────────────').flat().join('\n')}\n\n⚠️ → Informações sobre o local.\n\n❓ Tipo de request → ${wttrin.request.map(j => j.type).flat().join(' | ')}\n\n🗺️ Local do request → ${wttrin.request.map(j => j.query).flat().join(' | ')}\n\n🌐 Local mais aproximado → ${wttrin.nearest_area.map(j => j.latitude).flat().join(' | ')} Lat. | ${wttrin.nearest_area.map(j => j.longitude).flat().join(' | ')} Lon.\n\n⚖️ Populações → ${wttrin.nearest_area.map(j => j.population).flat().join(' | ')}\n\n📅 Data agora no local → ${wttrin.current_condition.map(j => j.localObsDateTime).flat().join(', ')}\n\n🕗 Tempo de observação → ${wttrin.current_condition.map(j => j.observation_time).flat().join(', ')}\n\n────────────`;

